function: "My wife, and her old sorority, are big fans of the Fleur De Lis. (A decorative lily.)\r\nAlso used (in various forms) by scouts, sports teams, and many others.\r\n\r\nWhen I finished assembling, testing, and calibrating my Thing-O-Matic, This was my first print as a way to thank her for indulging my nerdy obsessions.\r\n\r\nI didn't design it, I pulled it off the Google Sketchup warehouse. It can be found here http://sketchup.google.com/3dwarehouse/details?mid=4cf07fb6cf4105169eeaab05b21288d and design should be credited to user Frisky Dingo."
